import React from "react";
import {UserItem} from './Follow'

const Profile= function(props){
let myDetails={props}
let userList={props}

userList=[{
  username:'a.lover',
  name:'akshay neje'

},
{
  username:'onkar',
  name:'onkar kadam'
},
{
  username:'praju',
  name:'prajakta mali'

}]
myDetails={
  username:'me',
  tweets:0,
  follower:0,
  following:0

}
  return(
    <div>
    <div className="flex">
    <div id="profile" className="w-98 flex-1 flex items-center">
      <img
        src={myDetails.avatarUrl}
        alt={myDetails.username}
        className="h-12 w-16 rounded-full object-cover mr-8"
      />
    </div>
    <div className="flex flex-1 items-center">
  <div id="my-tweets" className="flex flex-col mx-4">
    <p className="text-center">{myDetails.tweets}</p>
    <p className="text-center ml-4">Tweets</p>
  </div>
  <div id="follower" className="flex flex-col items-center mx-4">
    <p className="text-center">{myDetails.follower}</p>
    <p className="text-center">Followers</p>
  </div>
  <div id="following" className="flex flex-col mx-4">
    <p className="text-center">{myDetails.following}</p>
    <p className="text-center">Following</p>
  </div>
</div>

  </div>
  <div id="list">
    {
      userList.map(element => (
        <UserItem key={element.id} userDetails={element} />
      ))
    }
  </div>
  </div>
  )
}

export {Profile}
